import React from 'react';

const LandingPage = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        width: '100%',
        height: '100vh',
      }}
    >
      <h2> Strat page</h2>
    </div>
  );
};

export default LandingPage;
